description:
Письма разных лиц К. П. Победоносцеву и другие материалы по Екатеринославской епархии. 1888 - 1905 гг. - 23 листа ; 36,5х26 см. - Рукописный текст. Чернила.
Письма и донесения:
1) Марии, настоятельницы Иосифовского монастыря, о монастыре и открытом при нем ските Всех Скорбящих Божией Матери Радости;
2) Покровского Ф., протоиерея Таганрогского собора, о вероятной отставке;
3) Преображенского Д., священника из села Горловка Бахмутского уезда Екатеринославской губернии, о закрытии полицией Горловского православного братства;
4) Симеона, епископа Екатеринославского и Таганрогского, об увольнении законоучителя Екатеринославской гимназии Новина и с ходатайством об отмене перевода в Единецкое духовное училище смотрителя Екатеринославского духовного училища С. Феодосьева.
Письма И. Наумовичу, протоиерею, миссионеру Киевской епархии, крестьянина П. И. Иванова и священника И. Кравченко о календаре-приложении к &lt;Церковным ведомостям&gt; и др. литературе.
Заметка неустановленного автора о деятельности настоятеля Ростовской-на-Дону Успенской церкви Ф. С. Руднева по борьбе с эпидемией холеры в Приазовском крае.
